import React from 'react';

export default function Internships() {
  const items = [
    { id: 1, company: 'Company A', role: 'Software Intern', period: '2022' },
    { id: 2, company: 'Company B', role: 'Research Intern', period: '2021' },
  ];

  return (
    <section id="internships" className="container page">
      <h2 className="page-title">Internships</h2>
      <p className="lead">Hands-on experience & contract work.</p>

      <div style={{ marginTop: 18, display: 'grid', gap: 12 }}>
        {items.map(it => (
          <div key={it.id} className="card">
            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
              <div>
                <h3 style={{ margin: 0 }}>{it.company}</h3>
                <p className="muted" style={{ margin: 0 }}>{it.role}</p>
              </div>
              <div className="muted">{it.period}</div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
